import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Navbar from "../../components/Navbar";
import "./Analytics.css";
import { Link } from "react-router-dom";

const Dashboard = () => {
  const [data, setData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
      const fetchData = async () => {
          try {
              const response = await axios.get('http://127.0.0.1:4000/analytics/getAllQuiz?user_email=a@gmail.com');
              console.log(response.data)
              setData(response.data);
          } catch (error) {
            setError(error);
          } finally {
            setLoading(false);
        }
      };
      fetchData();
  }, []);

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error.message}</div>;
  }

  return (
    <div>
      <Navbar></Navbar>
      <div class="page">
        <h2 class="head">Analytics</h2>
        <table class="table">
          <thead>
            <tr>
              <th>S.No</th>
              <th>Quiz Name</th>
              <th>Created On</th>
              <th>Imprresions</th>
              <th>Action</th>
              <th>Question wise Analysis Link</th>
            </tr>
          </thead>
          <tbody>
            {data && data.map((data, index) => (
              <tr key={index}>
                <td>{index + 1}</td>
                <td>{data.quiz_ame}</td>
                <td>{data.createdOn}</td>
                <td>{data.impressions}</td>
                <td>
                  <a>Edit</a> <a>Delete</a> <a>Share</a>
                </td>
                <td>
                  <Link to="/questionwiseanalysis">Link</Link>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default function Analytics() {
  return <Dashboard />;
}
